Ralph is at his friends house to try and learn some headbanging when he hurts his neck doing it.
His friend's mom, Sophia, offers Ralph a neck massage at her home office, to help bring down the
pain. While doing the massage, she notices a big bulge in his trunks and has a little hungry look
in her eyes that means only one thing... She'll give him a special sucky sucky treatment until all
the muscles in his body are fully relaxed to help the recovery of his neck injury.
